    "### **Ask**\n",
    "Sršen asks you to analyze smart device usage data in order to gain insight into how consumers use non-Bellabeat smar devices. She then wants you to select one Bellabeat product to apply these insights to in your presentation. These questions will guide your analysis:\n",
    "1. What are some trends in smart device usage?\n",
    "2. How could these trends apply to Bellabeat customers?\n",
    "3. How could these trends help influence Bellabeat marketing strategy?\n",
    "\n",
    "You will produce a report with the following deliverables:\n",
    "1. A clear summary of the business task\n",
    "2. A description of all data sources used\n",
    "3. Documentation of any cleaning or manipulation of data\n",
    "4. A summary of your analysis\n",
    "5. Supporting visualizations and key findings\n",
    "6. Your top high-level content recommendations based on your analysis\n",
    "\n",
    "Use the following Case Study Roadmap as a guide. Note: Completing this case study within a week is a good goal.\n",
    "\n",
    "#### **Case Study Roadmap - Ask**\n",
    "**Guiding questions**\n",
    "- What is the problem you are trying to solve?\n",
    "\n",
    "<span style=\"color:green\">*I am tasked with analyzing consumer data to identify key trends in smart device usage (excluding Bellabeat).*</span>\n",
    "\n",
    "- How can your insights drive business decisions?\n",
    "\n",
    "<span style=\"color:green\">*On one hand, the company can adapt its marketing strategy for existing products. On the other hand, we can use these trends as guidance to develop and introduce new products.*</span>\n",
    "\n",
    "**Key tasks**\n",
    "1. Identify the business task\n",
    "\n",
    "<span style=\"color:green\">*The business task involves identifying customers' needs and uncovering the development trends in the global smart device market in order to adapt marketing strategies and ultimately lead the industry.*</span>\n",
    "\n",
    "2. Consider key stakeholders\n",
    "\n",
    "<span style=\"color:green\">*The key stakeholders include Bellabeat's co-founders (i.e. Urška Sršen, Sando Mur), the Bellabeat marketing analytics team, Bellabeat's investigators, among others.*</span>\n",
    "\n",
    "**Deliverable**\n",
    "- [x] A clear statement of the business task"
   ]
  },
