    "### **Prepare**\n",
    "Sršen encourages you to use public data that explores smart device users’ daily habits. She points you to a specific data set:\n",
    "- [FitBit Fitness Tracker Data](https://www.kaggle.com/datasets/arashnic/fitbit) (CC0: Public Domain, dataset made available through [Mobius](https://www.kaggle.com/arashnic)): This Kaggle data set contains personal fitness tracker from thirty fitbit users. Thirty eligible Fitbit users consented to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring. It includes information about daily activity, steps, and heart rate that can be used to explore users’ habits.\n",
    "\n",
    "Sršen tells you that this data set might have some limitations, and encourages you to consider adding another data to help address those limitations as you begin to work more with this data.\n",
    "\n",
    "Now, prepare your data for analysis using the following Case Study Roadmap as a guide:\n",
    "\n",
    "#### **Case Study Roadmap - Prepare**\n",
    "**Guiding questions**\n",
    "- Where is your data stored?\n",
    "\n",
    "<span style=\"color:green\">*Initially, my data is stored in the Kaggle workspace. Additionally, I have created a copy on my laptop and in my GitHub repository.*</span>\n",
    "\n",
    "- How is the data organized? Is it in long or wide format?\n",
    "\n",
    "<span style=\"color:green\">*The data is organized into tables within CSV files. The majority of the data is in long format, where each line represents an entry. However, the files with \"Wide\" in their filename contain data in a mixed format, with hours in long format and minutes in wide format. This format is used to prevent the table from becoming excessively long.*</span>\n",
    "\n",
    "- Are there issues with bias or credibility in this data? [Does your data ROCCC?](https://www.coursera.org/learn/data-preparation/lecture/lHirM/what-is-bad-data)\n",
    "\n",
    "<span style=\"color:green\">*If we evaluate this dataset using the ROCCC criterion, it is evident that my data \"ROCCC\". According to the dataset's source page on Kaggle, the completeness, credibility, and compatibility are all scored at 100%. Hence, there is no doubt about the reliability and comprehensiveness of the data. Additionally, the dataset is annually updated by a reputable data scientist specializing in healthcare in Melbourne, ensuring its originality and currency. Moreover, the dataset has been downloaded over 89,368 times and integrated into more than 2,987 notebooks, making it highly cited.*</span>\n",
    "\n",
    "- How are you addressing licensing, privacy, security, and accessibility?\n",
    "\n",
    "<span style=\"color:green\">*The data is licensed under \"CC0 1.0 Universal (CC0 1.0) Public Domain Dedication.\" This license allows me to freely copy, modify, distribute, and perform the work, even for commercial purposes, without the need for permission. It is important to note that the data has been collected with users' consent.*</span>\n",
    "\n",
    "- How did you verify the data’s integrity?\n",
    "\n",
    "<span style=\"color:green\">*Although Kaggle scored this dataset's completeness at 100%, I still performed a quick check on each CSV file using R to ensure that there are no missing cells (without accounting for missing values noted as NA) and that each user (by its Id) fills in the same attributes/columns.*</span>\n",
    "\n",
    "- How does it help you answer your question?\n",
    "\n",
    "<span style=\"color:green\">*As one possible inspiration, I am considering exploring the relationship between daily or hourly data of various health factors, such as calories or steps, and sleep patterns. The goal is to recommend a smart device that can monitor and potentially enhance people's sleep quality.*</span>\n",
    "\n",
    "- Are there any problems with the data?\n",
    "\n",
    "<span style=\"color:green\">*After a quick check, I noticed that the \"daily\" data has been merged into the dailyActivity table. It is indeed worthwhile to do the same for the \"hourly\" data in order to facilitate collective operations within a single table.*</span>\n",
    "\n",
    "<span style=\"color:green\">*When I tried to import data in BigQuery, it could not parse timestamp for field Date in several tables. So I converted \"sleepDay\" and \"Date\" columns to the same format that can be recognized by BigQuery.*</span>\n",
    "\n",
    "<span style=\"color:green\">*The data type in the Id column should be integer instead of double precision numeric.*</span>\n",
    "\n",
    "<span style=\"color:green\">*Specifically for my analysis, the per-minute data appears a bit excessive. It also occupies too much storage space. As a result, I don't plan to use them in the first place. However, they may prove useful when we need to examine specific cases in detail.*</span>\n",
    "\n",
    "**Key tasks**\n",
    "1. Download data and store it appropriately.\n",
    "2. Identify how it’s organized.\n",
    "3. Sort and filter the data.\n",
    "4. Determine the credibility of the data.\n",
    "\n",
    "**Deliverable**\n",
    "- [x] A description of all data sources used"
   ]
