    "## sleepDay\n",
    "sleepDay$SleepDay = as.POSIXct(sleepDay$SleepDay, format=\"%m/%d/%Y %I:%M:%S %p\", tz=Sys.timezone())\n",
    "sleepDay$Date <- format(sleepDay$SleepDay, format=\"%m/%d/%y\")\n",
    "# cat(\"\\nhead(sleepDay)\")\n",
    "# head(sleepDay)\n",
    "\n",
    "## dailyActivity\n",
    "dailyActivity$ActivityDate = as.POSIXct(dailyActivity$ActivityDate, format=\"%m/%d/%Y\", tz=Sys.timezone())\n",
    "dailyActivity$Date <- format(dailyActivity$ActivityDate, format=\"%m/%d/%y\")\n",
    "# cat(\"\\nhead(dailyActivity)\")\n",
    "# head(dailyActivity)\n",
    "\n",
    "## Merge (inner join) sleepDay and dailyActivity\n",
    "sleep_activity <- merge(sleepDay, dailyActivity, by = c(\"Id\", \"Date\"))# %>% drop_na()\n",
    "\n",
    "## View merged table\n",
    "cat(\"\\nhead(sleep_activity)\")\n",
    "head(sleep_activity)\n",
    "# cat(\"\\nsummary(sleep_activity)\")\n",
    "# summary(sleep_activity)\n",
    "\n",
    "## Write merged table\n",
    "write_csv(sleep_activity, \"/kaggle/working/sleepActivity_merged.csv\")\n",
    "\n",
    "## hourly data\n",
    "hourly_data$ActivityHour = as.POSIXct(hourly_data$ActivityHour, format=\"%m/%d/%Y %I:%M:%S %p\", tz=Sys.timezone())\n",
    "hourly_data$Date <- format(hourly_data$ActivityHour, format=\"%m/%d/%y\")\n",
    "hourly_data$Time <- format(hourly_data$ActivityHour, format=\"%H/%M/%S\")\n",
    "\n",
    "## View merged table\n",
    "cat(\"\\nhead(hourly_data)\")\n",
    "head(hourly_data)\n",
    "\n",
    "## Write merged table\n",
    "write_csv(hourly_data, \"/kaggle/working/hourlyActivity_merged.csv\")"
   ]
