    "### **Analyze**\n",
    "Now that your data is stored appropriately and has been prepared for analysis, start putting it to work. Use the following Case\n",
    "Study Roadmap as a guide:\n",
    "\n",
    "#### **Case Study Roadmap - Analyze**\n",
    "**Guiding questions**\n",
    "- How should you organize your data to perform analysis on it?\n",
    "\n",
    "<span style=\"color:green\">*I am supposed to group the cleaned data into files with a consistent naming convention. At the same time, I need to ensure that the metadata is properly archived.*</span>\n",
    "\n",
    "- Has your data been properly formatted?\n",
    "\n",
    "<span style=\"color:green\">*Yes, I have fixed the data formatting during the last data processing phase.*</span>\n",
    "\n",
    "- What surprises did you discover in the data?\n",
    "\n",
    "<span style=\"color:green\">*The fact that all users' data share similar trends in various relationships surprised me. Given this, it is justified to apply these trends to develop new products.*</span>\n",
    "\n",
    "- What trends or relationships did you find in the data?\n",
    "\n",
    "<span style=\"color:green\">*First, I explored the intrinsic relationship within both the activity data and sleep data. The results turned out to be consistent with my intuition, such as the correlation between total asleep time and total time in bed.*</span>\n",
    "\n",
    "<span style=\"color:green\">*Similarly, I explained the discrepancy between the actual total distance and the distance estimated from total steps, taking into account steps on stairs or slopes. Otherwise, the step length is the main determining factor.*</span>\n",
    "\n",
    "<span style=\"color:green\">*As for the relationship between sedentary time and total steps, it varies among different users. A slight trend of more sedentary time leading to fewer total steps can be observed.*</span>\n",
    "\n",
    "<span style=\"color:green\">*When combining the activity and sleep data, I did not observe a clear trend between calories and total asleep time. However, it appears that longer sedentary time is associated with less sleep time at a global level.*</span>\n",
    "\n",
    "- How will these insights help answer your business questions?\n",
    "\n",
    "<span style=\"color:green\">*The idea is to develop a new product that caters to users' needs, whether they are aware of them or not. As an example, this analysis offers an intriguing and less apparent perspective on sedentary time. It is often the case that people focus more on the amount of physical activity they engage in, while overlooking the duration of their sedentary behavior. As a result, the new product should be capable of detecting users' sedentary status and providing suggestions on activities to engage in, as well as how to structure their sleep time.*</span>\n",
    "\n",
    "**Key tasks**\n",
    "1. Aggregate your data so it’s useful and accessible.\n",
    "2. Organize and format your data.\n",
    "3. Perform calculations.\n",
    "4. Identify trends and relationships.\n",
    "\n",
    "**Deliverable**\n",
    "- [x] A summary of your analysis\n",
    "\n",
    "<span style=\"color:green\">*In this analysis, I explored various aspects of the entire dataset, focusing on the factors that influence sleep quality. To begin with, I examined the activity and sleep datasets separately to determine if there are any related factors. This step helped to reduce some redundancy when I combined both datasets to investigate the relationships between daytime activities and sleep quality. I primarily compared the effects of daily calorie consumption, sedentary time, and total steps on daily sleep duration. In particular, sedentary time exhibited the most prominent negative correlation with sleep duration. Lastly, I recommend further data collection on users' sedentary behavior and the development of corresponding products to provide users with fitness assistance.*</span>\n",
