   "source": [
    "cat(\"\\ncolnames(sleep_activity)\")\n",
    "colnames(sleep_activity)\n",
    "\n",
    "options(repr.plot.width = 12, repr.plot.height = 10)\n",
    "\n",
    "ggplot(data = sleep_activity) +\n",
    "  geom_point(mapping = aes(x=TotalTimeInBed, y=TotalMinutesAsleep, color=factor(Id)), size=2) +\n",
    "  geom_line(mapping = aes(x=TotalTimeInBed, y=TotalTimeInBed), color=\"grey\", linetype=\"dashed\") +\n",
    "  theme(axis.title = element_text(size=16),\n",
    "        axis.text = element_text(size=16),\n",
    "        legend.title = element_text(size=16),\n",
    "        legend.text = element_text(size=16)) +\n",
    "  guides(color = guide_legend(title=\"Id\", ncol=1))\n",
    "\n",
    "ggsave(\"TotalMinutesAsleep_TotalTimeInBed.png\", width=12, height=10,\n",
    "       bg=\"transparent\")\n",
    "while (!is.null(dev.list()))  dev.off()"
   ]
