   "source": [
    "- The relationship between total steps and sedentary time is not universal for all users in our sample. Even for individual users, we can observe many dispersed points. However, when excluding some outliers, we can observe a clear anti-correlation for each individual. That is, the more one walks, the less time he or she stays sedentary."
   ]
