   "source": [
    "options(repr.plot.width = 20, repr.plot.height = 36)\n",
    "\n",
    "## Create a group-means dataset\n",
    "gd <- sleep_activity %>%\n",
    "  group_by(Id) %>%\n",
    "    summarise(\n",
    "      TotalMinutesAsleep = mean(TotalMinutesAsleep)\n",
    "    )\n",
    "\n",
    "## Plot both dataset\n",
    "ggplot() +\n",
    "  geom_point(data = sleep_activity, mapping = aes(x=Date, y=TotalMinutesAsleep, color=factor(Id)), size = 2) +\n",
    "  geom_hline(data = sleep_activity, mapping = aes(yintercept=mean(TotalMinutesAsleep)), color = \"black\") +\n",
    "  facet_wrap(~Id, ncol=2) +\n",
    "  geom_hline(data = gd, mapping = aes(yintercept=TotalMinutesAsleep, color=factor(Id))) +\n",
    "  theme(axis.title = element_text(size=16),\n",
    "        axis.text = element_text(size=14),\n",
    "        axis.text.x = element_text(angle=90),\n",
    "        legend.title = element_text(size=16),\n",
    "        legend.text = element_text(size=16)) +\n",
    "  guides(color = guide_legend(title=\"Id\", ncol=1))\n",
    "\n",
    "ggsave(\"dailyTotalMinutesAsleep.png\", width=20, height=36,\n",
    "       bg=\"transparent\")\n",
    "while (!is.null(dev.list()))  dev.off()\n",
    "\n",
    "file.remove(\"Rplot001.png\")"
   ]
  },
