   "source": [
    "#### Explore Sleep - Activity trends\n",
    "- Daily calorie consumption and total sleep duration do not exhibit a consistent pattern for all users in our sample. On an individual level, the correlations vary. In some cases, like the user 5577150313, they appear to be unrelated. However, I am inclined to maintain the idea of customizing calorie consumption suggestions based on certain patterns detected by our device with sleep data.\n",
    "- Daily sedentary time shows a strong negative correlation with sleep duration. This relationship is observed consistently within our sample.\n",
    "- Total steps, similar to daily calorie consumption, are not directly linked to sleep duration."
   ]
