   "source": [
    "library(gridExtra)\n",
    "\n",
    "options(repr.plot.width = 20, repr.plot.height = 8)\n",
    "\n",
    "ggp0 <- ggplot(data = sleep_activity) +\n",
    "  geom_point(mapping = aes(x=TotalMinutesAsleep, y=Calories, color=factor(Id)), size = 2) +\n",
    "  theme(axis.title = element_text(size=16),\n",
    "        axis.text = element_text(size=16),\n",
    "        legend.title = element_text(size=16),\n",
    "        legend.text = element_text(size=16)) +\n",
    "  guides(color = guide_legend(title=\"Id\", nrow=3))\n",
    "\n",
    "ggp1 <- ggplot(data = sleep_activity) +\n",
    "  geom_point(mapping = aes(x=TotalMinutesAsleep, y=Calories, color=factor(Id)), size = 2) +\n",
    "  theme(legend.position = \"none\")\n",
    "ggp2 <- ggplot(data = sleep_activity) +\n",
    "  geom_point(mapping = aes(x=TotalMinutesAsleep, y=SedentaryMinutes, color=factor(Id)), size = 2) +\n",
    "  theme(legend.position = \"none\")\n",
    "ggp3 <- ggplot(data = sleep_activity) +\n",
    "  geom_point(mapping = aes(x=TotalMinutesAsleep, y=TotalSteps, color=factor(Id)), size = 2) +\n",
    "  theme(legend.position = \"none\")\n",
    "\n",
    "## Extract legend\n",
    "extract_legend <- function(plot) {\n",
    "  ## Get tabular interpretation of plot\n",
    "  plot_table <- ggplot_gtable(ggplot_build(plot))\n",
    "  ## Mark only legend in plot\n",
    "  legend_plot <- which(sapply(plot_table$grobs, function(x) x$name) == \"guide-box\")\n",
    "  ## Extract legend\n",
    "  legend <- plot_table$grobs[[legend_plot]]\n",
    "  ## Return legend\n",
    "  return(legend)\n",
    "}\n",
    "\n",
    "gglegend <- extract_legend(ggp0)\n",
    "ggp_comb <- arrangeGrob(ggp1, ggp2, ggp3, ncol=3)\n",
    "ggp_final <- grid.arrange(ggp_comb, gglegend, nrow=2, heights=c(5,1))\n",
    "\n",
    "ggsave(\"sleep_factors.png\", plot=ggp_final, width=20, height=8,\n",
    "       bg=\"transparent\")\n",
    "while (!is.null(dev.list()))  dev.off()\n",
    "\n",
    "## Clean tmp\n",
    "file.remove(\"Rplot001.png\")\n",
    "file.remove(\"Rplot002.png\")"
   ]
