    "### **Share**\n",
    "Once you have completed your analysis, create your data visualizations. The visualizations should clearly communicate your high-level insights and recommendations. Use the following Case Study Roadmap as a guide:\n",
    "\n",
    "#### **Case Study Roadmap - Share**\n",
    "**Guiding questions**\n",
    "- Were you able to answer the business questions?\n",
    "\n",
    "<span style=\"color:green\">*Now that I have extracted several trends from my analysis, I am able to answer Bellabeat's questions regarding the smart device market and provide advice on business strategies based on the user needs revealed by the data.*</span>\n",
    "\n",
    "- What story does your data tell?\n",
    "\n",
    "<span style=\"color:green\">*By linking calories to weight control, daily sedentary time to short-term fitness levels, total steps to daily activity levels, and other factors, my data can provide a comprehensive view of the health status of the sample users. In particular, if a customer wants to achieve a specific goal, the Bellabeat application should be capable of assessing her and providing the best program and daily suggestions. For more complex goals, such as improving sleep quality, which is influenced by various factors, the Bellabeat application will be able to synthesize and analyze all the collected data to become a real-time personal health assistant.*</span>\n",
    "\n",
    "- How do your findings relate to your original question?\n",
    "\n",
    "<span style=\"color:green\">*My analysis report provides specific marketing guidance, among others. One key recommendation is the development of a data synthesis algorithm to help customers recognize their health predictions and assist them in achieving their fitness goals.*</span>\n",
    "\n",
    "- Who is your audience? What is the best way to communicate with them?\n",
    "\n",
    "<span style=\"color:green\">*My audience primarily consists of Bellabeat's co-founders (Urška Sršen, Sando Mur), the Bellabeat marketing analytics team, and Bellabeat's investigators. We could maintain communication by sharing ideas and results through a somehow archivable and confidential mailing system.*</span>\n",
    "\n",
    "- Can data visualization help you share your findings?\n",
    "\n",
    "<span style=\"color:green\">*Data visualization can certainly help communicate my findings, especially for those that may not appear intuitive. The curves and graphics never deceive.*</span>\n",
    "\n",
    "- Is your presentation accessible to your audience?\n",
    "\n",
    "<span style=\"color:green\">*Definitely, yes.*</span>\n",
    "\n",
    "**Key tasks**\n",
    "1. Determine the best way to share your findings.\n",
    "2. Create effective data visualizations.\n",
    "3. Present your findings.\n",
    "4. Ensure your work is accessible.\n",
    "\n",
    "**Deliverable**\n",
    "- [x] Supporting visualizations and key findings\n",
    "\n",
    "#### **Follow these steps:**\n",
    "1. Take out a piece of paper and a pen and sketch some ideas for how you will visualize the data.\n",
    "2. Once you choose a visual form, open your tool of choice to create your visualization. Use a presentation software, such as PowerPoint or Google Slides; your spreadsheet program; Tableau; or R.\n",
    "3. Create your data visualization, remembering that contrast should be used to draw your audience’s attention to the most important insights. Use artistic principles including size, color, and shape.\n",
    "4. Ensure clear meaning through the proper use of common elements, such as headlines, subtitles, and labels.\n",
    "5. Refine your data visualization by applying deep attention to detail."
